import React from 'react';
import {Link} from 'react-router-dom';
import {NavStyle, NavContainer} from '../styled/theme';
import {useSelector} from 'react-redux';
const Navbar = () => {
	const session = useSelector( 
		state => state.session,
	);
	return(
		<NavStyle>
			<NavContainer>
				<li className="logo">
					<Link to="/"></Link>
					TravelStory</li>
				<li>Home</li>
				<li>Profile</li>
				<li>Search</li>
				<li>Logout</li>
			</NavContainer>
		</NavStyle>);
};

export default Navbar;
